      />
      <ProjectCard
        index="01"
        title="E-Commerce Platform"
        description="A full-stack e-commerce solution with real-time inventory management and payment processing."
        tech={["React", "Node.js", "MongoDB", "Stripe"]}
      />
    </section>
  );
};

export default Projects;
